void wait_for_vsync(){
	volatile int * pixel_ctrl_ptr = (int *) 0xff203020; 
	* pixel_ctrl_ptr = 1;
	int status= *(pixel_ctrl_ptr+3);
	while(status &1 ==1){
		status= *(pixel_ctrl_ptr+3);
	}
}

void draw_line(short int x0, short int y0, short int x1, short int y1,short int line_colour){
	bool is_steep = abs(y1-y0)>abs(x1-x0);
	int temp;
    //line bresenham algorithm used
	if(is_steep){
		temp = x0; 
		x0 = y0;
		y0 = temp;
		temp =x1;
		x1 =y1;
		y1 =temp;
	}
	if(x0>x1){
		temp = x0; 
		x0 = x1;
		x1 = temp;
		temp = y0; 
		y0 = y1;
		y1 = temp;
	}
	int deltax = x1-x0;
	int deltay = abs(y1-y0);
	int error = -(deltax/2);
	int y= y0;
	int y_step;
	if(y0<y1){
		y_step =1;
	}
	else{
		y_step = -1;
	}
	for(int x =x0; x<x1; x++){
		if(is_steep){
			plot_pixel(y,x,line_colour);
		}
		else{
			plot_pixel(x,y,line_colour);
		}
		error = error +deltay;
		if(error>0){
			y=y+y_step;
			error = error -deltax;
		}
	}
}


